import React from 'react';
import Card from './Card.js';

class Developers extends React.Component {
    render() {
        return (
            <div>
                <Card id={0} name='Saurish Sharma' email='isaurishsharma@gmail.com'/>
                <Card id={1} name='Raghav Phophaliya' email='raghavphophaliya@gmail.com'/>
            </div>
        );
    }
}

export default Developers;
